import React, { Component } from 'react';
import { Link } from "react-router-dom";
import './navbar.css'


class Navbar extends Component{


  render() {

    return (
        <div className="Navbar">

          <Link className="Navbar-link" to="/" style = {{ borderBottom: this.state.hasAccount ? '2px solid black' : undefined }}>Home</Link>
          <Link className="Navbar-link" to="/settings" style = {{ borderBottom: this.state.hasAccount ? '2px solid black' : undefined }}>Settings</Link>
          <Link className="Navbar-link" to="/" onClick = { this.props.logOut } style = {{ borderBottom: this.state.hasAccount ? '2px solid black' : undefined }}> Logout </Link>

        </div>
    )
  }
}

export default Navbar;
